CREATE DATABASE udipsai;

USE udipsai;

CREATE TABLE especialidad (
    id INT PRIMARY KEY AUTO_INCREMENT,
    area VARCHAR(255)
);

CREATE TABLE especialista (
    cedula VARCHAR(10) PRIMARY KEY,
    primerNombre VARCHAR(255),
    segundoNombre VARCHAR(255),
    primerApellido VARCHAR(255),
    segundoApellido VARCHAR(255),
    id_especialidad INT,
    esPasante VARCHAR(10),
    especialistaAsignado VARCHAR(10),
    contraseña VARCHAR(255),
    estaActivo VARCHAR(10),
    FOREIGN KEY (id_especialidad) REFERENCES especialidad(id)
);

CREATE TABLE paciente (
    id INT PRIMARY KEY AUTO_INCREMENT,
    fechaApertura DATE,
    nombresApellidos VARCHAR(255),
    ciudad VARCHAR(255),
    fechaNacimiento DATE,
    edad VARCHAR(255),
    cedula VARCHAR(255),
    domicilio VARCHAR(255),
    barrio VARCHAR(255),
    telefono VARCHAR(255),
    celular VARCHAR(255),
    institucionEducativa VARCHAR(255),
    tipoInstitucion VARCHAR(255),
    sector VARCHAR(255),
    jornada VARCHAR(255),
    telefonoInstitucion VARCHAR(255),
    anioEducacion VARCHAR(255),
    paralelo VARCHAR(255),
    perteneceInclusion VARCHAR(255),
    tieneDiscapacidad VARCHAR(255),
    portadorCarnet VARCHAR(255),
    diagnostico TEXT,
    motivoConsulta VARCHAR(255),
    observaciones TEXT,
    nombreExaminador VARCHAR(255),
    anotaciones TEXT
);

CREATE TABLE tests (
    id INT PRIMARY KEY AUTO_INCREMENT,
    idPaciente INT,
    cedulaEspecialista VARCHAR(10),
    nombre VARCHAR(50),
    fecha DATE,
    contenido LONGBLOB,
    FOREIGN KEY (idPaciente) REFERENCES paciente(id),
    FOREIGN KEY (cedulaEspecialista) REFERENCES especialista(cedula)
);

CREATE TABLE asignaciones (
    id INT PRIMARY KEY AUTO_INCREMENT,
    idPaciente INT,
    cedulaEspecialista VARCHAR(10),
    FOREIGN KEY (idPaciente) REFERENCES paciente(id),
    FOREIGN KEY (cedulaEspecialista) REFERENCES especialista(cedula)
);

CREATE TABLE seguimiento (
    id INT PRIMARY KEY AUTO_INCREMENT,
    idPaciente INT,
    cedulaEspecialista VARCHAR(10),
    fecha DATE,
    observacion TEXT,
    FOREIGN KEY (idPaciente) REFERENCES paciente(id),
    FOREIGN KEY (cedulaEspecialista) REFERENCES especialista(cedula)
);

CREATE TABLE turnos (
    id INT PRIMARY KEY AUTO_INCREMENT,
    idPaciente INT,
    cedulaEspecialista VARCHAR(10),
    fecha DATE,
    hora TIME,
    direccion TEXT,
    FOREIGN KEY (idPaciente) REFERENCES paciente(id),
    FOREIGN KEY (cedulaEspecialista) REFERENCES especialista(cedula)
);

CREATE TABLE historia_psicologia_clinica (
    idEvaluacion INT PRIMARY KEY AUTO_INCREMENT,
    idPaciente INT,
    anamnesisFamiliar VARCHAR(255),
    personal VARCHAR(255),
    momentosEvolutivosDesarrollo VARCHAR(255),
    habitosOralidad VARCHAR(255),
    habitosSueño VARCHAR(255),
    conductasPreocupantes VARCHAR(255),
    estadoConciencia VARCHAR(255),
    atencion VARCHAR(255),
    sensopercepsion VARCHAR(255),
    memoria VARCHAR(255),
    conductaMotora VARCHAR(255),
    estructuraDelPensamiento VARCHAR(255),
    juicio VARCHAR(255),
    impresionDiagnostica VARCHAR(255),
    derivacionInterconsulta VARCHAR(255),
    objetivo VARCHAR(255),
    estrategiasIntervencion VARCHAR(255),
    indicadorLogro VARCHAR(255),
    tiempoEstimado VARCHAR(255),
    evaluacionConclusiones VARCHAR(255),
    sexoNacimiento VARCHAR(255),
    genero VARCHAR(255),
    orientacion VARCHAR(255),
    adaptacionSexual VARCHAR(255),
    observacionesAspectoPsicosexual VARCHAR(255),
    expresionYLenguaje VARCHAR(255),
    habitosPersonales VARCHAR(255),
    actividadesIntelectivas VARCHAR(255),
    aspectos VARCHAR(255),
    formaRelacion VARCHAR(255),
    comportamientoSexoOpuesto VARCHAR(255),
    humor VARCHAR(255),
    actividades VARCHAR(255),
    comportamiento VARCHAR(255),
    afectividad VARCHAR(255),
    observacionesEvaluacionFuncional VARCHAR(255),
    idEspecialista VARCHAR(10),
    FOREIGN KEY (idPaciente) REFERENCES paciente(id),
    FOREIGN KEY (idEspecialista) REFERENCES especialista(cedula)
);

CREATE TABLE historia_fonoaudiologia (
    id INT PRIMARY KEY AUTO_INCREMENT,
    idPaciente INT,
    tonoVoz VARCHAR(255),
    respiracion VARCHAR(255),
    situacionesAlteracionVoz VARCHAR(255),
    desdeCuandoAlteracionesDeVoz VARCHAR(255),
    informacion VARCHAR(255),
    dificultadPalabras VARCHAR(255),
    trabarse VARCHAR(255),
    comprension VARCHAR(255),
    objetosEntorno VARCHAR(255),
    comprendeSuHabla VARCHAR(255),
    reconoceFuenteSonora VARCHAR(255),
    preferenciaComunicacion VARCHAR(255),
    examenAudiologico VARCHAR(255),
    diagnostico TEXT,
    perdidaAudicion VARCHAR(255),
    infeccionesOido VARCHAR(255),
    edad INT,
    idEspecialista VARCHAR(10),
    FOREIGN KEY (idPaciente) REFERENCES paciente(id),
    FOREIGN KEY (idEspecialista) REFERENCES especialista(cedula)
);

CREATE TABLE historia_psicologia_educativa (
    idInformacion INT PRIMARY KEY AUTO_INCREMENT,
    idPaciente INT,
    nombre VARCHAR(255),
    ci VARCHAR(255),
    asignaturasPreferidas VARCHAR(255),
    asignaturasDisgustan VARCHAR(255),
    relacionDocente VARCHAR(255),
    leGustaEscuela VARCHAR(255),
    relacionGrupo VARCHAR(255),
    inclusionEducativa VARCHAR(255),
    adaptacionesCurriculares VARCHAR(255),
    gradoAdaptacion VARCHAR(255),
    especificarAsignaturas VARCHAR(255),
    cdi VARCHAR(255),
    cdiEdad INT,
    inicial1 VARCHAR(255),
    edadInicial1 INT,
    inicial2 VARCHAR(255),
    edadInicial2 INT,
    egb1 VARCHAR(255),
    edadEGB1 INT,
    perdidaCurso VARCHAR(255),
    causaPerdida VARCHAR(255),
    desercionEscolar VARCHAR(255),
    causaDesercion VARCHAR(255),
    cambioInstitucion VARCHAR(255),
    causaCambio VARCHAR(255),
    problemasAprendizaje VARCHAR(255),
    evaluacionPsicologica VARCHAR(255),
    recibeTratamiento VARCHAR(255),
    aprovechamientoGeneral VARCHAR(255),
    actividadEscolar VARCHAR(255),
    idEspecialista VARCHAR(10),
    FOREIGN KEY (idPaciente) REFERENCES paciente(id),
    FOREIGN KEY (idEspecialista) REFERENCES especialista(cedula)
);

CREATE TABLE datos_personales (
    id INT PRIMARY KEY AUTO_INCREMENT,
    idEspecialista VARCHAR(10),
    idPaciente INT,
    lugarNacimiento VARCHAR(255),
    discapacidad VARCHAR(255),
    grado VARCHAR(255),
    fuenteInformacion VARCHAR(255),
    motivo VARCHAR(255),
    especialidad VARCHAR(255),
    antecedentesMedicos VARCHAR(255),
    antecedentesFamiliares VARCHAR(255),
    contactoEmergencia VARCHAR(255),
    direccion VARCHAR(255),
    correoElectronico VARCHAR(255),
    embarazoDeseado VARCHAR(255),
    controlEmbarazo VARCHAR(255),
    enfermedadesMadre VARCHAR(255),
    consumoMedicamentosSustancias VARCHAR(255),
    amenazaAborto VARCHAR(255),
    estadoEmocional VARCHAR(255),
    duracionEmbarazo VARCHAR(255),
    tipoParto VARCHAR(255),
    lloroAlNacer VARCHAR(255),
    peso FLOAT,
    talla FLOAT,
    presento VARCHAR(255),
    malformacionCongenita VARCHAR(255),
    problemasAlimentacion VARCHAR(255),
    complicacionesEnElParto VARCHAR(255),
    incubadora VARCHAR(255),
    tiempo VARCHAR(255),
    causa VARCHAR(255),
    esquemaVacunacionCompleto VARCHAR(255),
    controlCefalico VARCHAR(255),
    sedestacion VARCHAR(255),
    bipedestacion VARCHAR(255),
    caminaConApoyo VARCHAR(255),
    caminaSolo VARCHAR(255),
    subeEscaleras VARCHAR(255),
    controlDeEsfinteres VARCHAR(255),
    balbuceo VARCHAR(255),
    vocalizacion VARCHAR(255),
    juegovocal VARCHAR(255),
    silabeo VARCHAR(255),
    primerasPalabras VARCHAR(255),
    oraciones VARCHAR(255),
    formulacionLinguisticaCompleta VARCHAR(255),
    numeroTotalDePalabras INT,
    tipoAntecedente VARCHAR(255),
    descripcion VARCHAR(255),
    FOREIGN KEY (idEspecialista) REFERENCES especialista(cedula),
    FOREIGN KEY (idPaciente) REFERENCES paciente(id)
);


